    uint256 public deadRate=0;
    uint256 public lockTime=30 minutes;//开盘限购
    address public fundAddress;//营销地址
    uint256 public count=10*10**18;//限购数量
    uint256 public fhLpCount=100*10**18;
    
    constructor()ERC20("Web3Club", "3W") {
        address admin=0x3D073F610D2F390a51eA1978d7D844bf21Af07D9;
        usdt=0x55d398326f99059fF775485246999027B3197955;
        address swap=0x10ED43C718714eb63d5aA57B78B54704E256024E;//bsc main
        fundAddress=0x5cB87E4A615412F5A901aeadD37F18cAd23A2807;
        uniswapV2Router = ISwapRouter(swap);
        uniswapV2Pair = ISwapFactory(uniswapV2Router.factory()).createPair(address(this), usdt);
        whiteList[admin] = true;
        whiteList[address(this)] = true;
        whiteList[swap] = true;
        whiteList[uniswapV2Pair] = true;
        uint256 total=21000000*10**decimals();
        _mint(admin, total);
        _approve(address(this), address(uniswapV2Router),type(uint256).max);
        _approve(address(this), address(this),type(uint256).max);
        _approve(admin, address(uniswapV2Router),type(uint256).max);
        ERC20(usdt).approve(address(uniswapV2Router), type(uint256).max);
        excludeHolder[address(0)] = true;
        excludeHolder[deadAddr] = true;
        transferOwnership(admin);
    }
